def exec_cmd(cmd):
    process = Popen(cmd.split(), stdout=PIPE)
    output, error = process.communicate()
    return output, error


##
# Check that the substring of tx that starts from start_point is the
# content of an OP_RETURN command. start_point is the distanche of
# the first letter of the substring from the beginning of tx
def is_OP_RETURN(tx_re, tx, start_pt, str_len):
    ret = False
    try:
        str_to_find = tx[start_pt - 1: start_pt - 1 + str_len]
        d = json.loads(tx_re)
        if 'result' in d.keys():
            d = d['result']
        for key in d:
            if key == 'vout' and isinstance(d[key], list):
                for i in d[key]:
                    for key in i:
                        if key == 'scriptPubKey':
                            op_r = i[key]
                            if "OP_RETURN" in op_r['asm']:
                                ret = (str_to_find == op_r['hex'][4:])
                                if ret:
                                    return ret
                                else:
                                    ret = False
        return ret
    except:
        return ret


##
# Check if the string to check is the content f a coinbase transaction.
# start_pt is the distanche of the first letter of the substring
# from the beginning of tx
def isCOIN_BASE(tx_re, tx, start_pt, str_len):
    try:
        str_to_find = tx[start_pt - 1: start_pt - 1 + str_len]
        d = json.loads(tx_re)
        return (d['result']['vin'][0]['coinbase'] == str_to_find)
    except:
        return False


##
# Substitute the string to delete in the transaction and return
# the string deleted by the transaction, the original transaction
# and the transaction with the byte deleted
def substitute_bits(tx, tx_re, start_pts, str_lens):
    replaced = ""
    new_tx_list = list((tx + '.')[:-1])
    for i in range(len(start_pts)):
        if is_OP_RETURN(tx_re, tx, start_pts[i], str_lens[i]) or isCOIN_BASE(tx_re, tx, start_pts[i], str_lens[i]):
            for j in range(str_lens[i]):
                replaced = replaced + tx[j + start_pts[i] - 1]
                new_tx_list[j + start_pts[i] - 1] = '0'
        else:
            raise Exception
    return replaced, tx, ''.join(new_tx_list)


##
# If the transaction to obtain from the blockchain is not the transaction in the
# genesis block, use getrawtransaction to take the hexadecimal code by the
# blockchain and generate the new hexadecimal code modifying the bytes frm start_len
# for a number of byte equal to str_len/2
def std_tx(txid, start_pt, str_len):
    bashCommand = "bitcoin-cli getrawtransaction " + txid
    bashCommandTrue = bashCommand + " true"
    try:
        output, error = exec_cmd(bashCommand)
        out = output.decode("ascii")
        output2, error2 = exec_cmd(bashCommandTrue)
        out2 = output2.decode("utf-8")
        out2 = re.sub(r"\s+", "", out2)
        return substitute_bits(out, out2, start_pt, str_len)
    except Exception as e:
        print(str(e))


