##
# given the path to a file f, a message msg to store in the file, a bollean value b that is true if the
# file has to be padded to the length specified by total_len with value "00"
def write_bytes_to_file(f, msg, b, total_len):
    msg_len = int(len(msg) / 2)
    with open(f, 'wb') as f2:
        i = 0
        j = 0
        while j < msg_len:
            a = msg[i] + msg[i + 1]
            r = convert(a)
            binary_format = bytearray([r])
            n = f2.write(binary_format)
            i = i + 2
            j = j + 1
        if b:
            for i in range(int(msg_len), int(total_len)):
                r = convert('00')
                binary_format = bytearray([r])
                n = f2.write(binary_format)


##
# Takes a path to a directory in input, if the directory does not exists, the function creates it
def make_dirs(path):
    try:
        os.makedirs(path)
    except OSError as e:
        if e.errno != errno.EEXIST:
            raise


##
# Given the hex of the removed string repl_str, the hex of the original transaction old,
# the hex of the transaction modified, the number of the modified bytes length and
# the transaction identifier txid
#   - makes a new directory that will contain all data of the current transaction with name the value of the txid;
#   - in the directory "txid" stores a file deleted_data with the bytes removed by the original transaction
#   - in the directory "txid" stores a file original_tx.dat containing the original transaction (to be removed)
#   - in the directory "txid" stores a file transaction containing the modified transaction.
# Returns the path to the folder related to the current transaction.
def generate_files(repl_str, old, new, length, txid, del_data):
    p = os.path.join(FILES_FOR_PROOF, txid)
    make_dirs(p)
    repl_str_file = os.path.join(p, REPL_STR_FILE)
    orig_tx_file = os.path.join(p, ORIG_TX_FILE)
    mod_tx_file = os.path.join(p, MOD_TX_FILE)
    write_bytes_to_file(repl_str_file, repl_str, True, int(del_data))
    write_bytes_to_file(orig_tx_file, old, False, 0)
    write_bytes_to_file(mod_tx_file, new, True, length)
    return p


##
# Given a number l, computes the smallest power of two that is bigger then l
def compute_max_circuit_len(l):
    target = 1
    while target < l:
        target = target * 2
    return target


##
# Given the ranges of bytes to delete in the transaction, generates length couples, where the first element is the
# position of the first byte of the substring to remove and the second element is the position of the last byte
# of the substring to remove. If the substrings to remove are less then the elements in start_pts,
# the remaining couples are equal to a couple of 0
def gen_couples(start_pts, str_lens, length):
    couples = ''
    for i in range(len(start_pts)):
        start_pt = int((start_pts[i]) / 2)
        str_len = int(str_lens[i] / 2)
        couples = couples + " " + str(start_pt) + " " + str(start_pt + str_len - 1)
    for i in range(length - len(start_pts)):
        couples = couples + ' ' + '0 0'
    return couples


def copy_sh_files(proof_dir):
    files_to_copy = glob.glob(os.path.join(SH_FOR_PROOF, "*.sh"))
    for file in files_to_copy:
        shutil.copy(file, proof_dir)


def setup_for_proof(replaced_str, old_tx, new_tx, length, del_data, txid):
    proof_dir = generate_files(replaced_str, old_tx, new_tx, length, txid, del_data)
    copy_sh_files(proof_dir)
    os.chdir(proof_dir)
    return proof_dir


def write_json_file(txid, length, couples, del_data_len, tx_size, old_hash, new_hash, new_tx):
    data = dict()
    try:
        with open(PROOFJSON_PATH) as json_file:
            data = json.load(json_file)
    except IOError:
        print("File not accessible")
    d = {txid: {'length': length, 'couples': couples, 'del_data_len': del_data_len,
                'tx_size': tx_size, 'old_hash': old_hash, 'new_hash': new_hash,
                'path': os.path.join(FILES_FOR_PROOF, txid), "new_tx": new_tx}}
    data.update(d)
    with open(PROOFJSON_PATH, 'w') as f:
        json.dump(data, f)


##
# Return the first multiple of 64 bigger than repl_len.
def max_del_data(repl_len):
    fact = math.ceil(float(repl_len) / 64)
    ret = 64 * fact
    return int(ret)


##
# Return the first number such that max_len plus an evaluated value t s.t. (max_len + t) % 64 = 56
def padded_len(max_len):
    max_len_bit = max_len * 8
    k = 0
    while ((max_len_bit + 1 + k) % 512 != 448):
        k = k + 1
    return (max_len_bit + 1 + k) / 8


def compute_circuit(command, max_circuit_len, del_data, proof_dir):
    params0 = " ".join(["C", str(max_circuit_len), str(del_data)])
    cmd = command + params0
    filen = str(max_circuit_len) + '_' + str(del_data)
    make_dirs(CIRCUITS)
    files = os.listdir(CIRCUITS)
    if filen in files:
        shutil.copyfile(os.path.join(CIRCUITS, filen), os.path.join(proof_dir, "hash.j1"))
        return
    exec_cmd(cmd)
    rcs = os.path.join(proof_dir, "hash.j1")
    shutil.copyfile(rcs, os.path.join(CIRCUITS, filen))


def compute_witness_files(command, max_circuit_len, del_data, couples, old_len, proof_dir):
    params1 = " ".join(["W", str(max_circuit_len), couples, str(del_data), str(old_len)])
    cmd = command + params1
    exec_cmd(cmd)


def compute_proof(command, max_circuit_len, couples, del_data, old_len):
    params2 = " ".join(["P", str(max_circuit_len), couples, str(del_data), str(old_len)])
    cmd = command + params2
    exec_cmd(cmd)


def generate_proof(replaced_str, old_tx, new_tx, starting_pt, str_lens, txid):
    old_tx = old_tx.rstrip()
    new_tx = new_tx.rstrip()
    replaced_str = replaced_str.rstrip()
    repl_len = int(len(replaced_str) / 2)
    del_data = max_del_data(repl_len)
    old_len = int(len(old_tx) / 2)
    starting_pt = [x - 1 for x in starting_pt]
    # max_circuit_len = padded_len(old_len)
    # max_circuit_len = max_del_data(old_len)
    max_circuit_len = 2024
    proof_dir = setup_for_proof(replaced_str, old_tx, new_tx, max_circuit_len, del_data, txid)
    command = PROOF_GENERATOR + " "
    couples = gen_couples(starting_pt, str_lens, max_circuit_len)
    compute_circuit(command, max_circuit_len, del_data, proof_dir)
    compute_witness_files(command, max_circuit_len, del_data, couples, old_len, proof_dir)
    compute_proof(command, max_circuit_len, couples, del_data, old_len)
    return str(max_circuit_len), couples, str(del_data), str(old_len)


def in_list(a):
    if a[0] == '[':
        a = a[1:-1]
        a = a.split(',')
        return [int(i) for i in a]
    if not isinstance(a, list):
        return [int(a)]
    else:
        raise Exception


def adapt(starts, lens):
    n_starts = list()
    n_lens = list()
    for i in range(len(starts)):
        n_starts.append(starts[i] * 2 - 1)
        n_lens.append(lens[i] * 2)
    return n_starts, n_lens


# switch the endianness of a given string
def revEndian(string):
    return ''.join(reversed([string[i:i + 2] for i in range(0, len(string), 2)]))


##convert a bytebuffer into a string
def hashStr(bytebuffer):
    return str(codecs.encode(bytebuffer, 'hex'))[2:-1]


##find the double sha256 hash for a given hex string
def doubleSha256(hex):
    bin = codecs.decode(hex, 'hex')
    hash = hashlib.sha256(bin).digest()
    hash2 = hashlib.sha256(hash).digest()
    return revEndian(hashStr(hash2))


def eval_hash(old_tx, new_tx):
    old_tx = old_tx.rstrip()
    new_tx = new_tx.rstrip()
    old_hash = doubleSha256(old_tx)
    new_hash = doubleSha256(new_tx)
    return old_hash, new_hash


def main():
    txid = sys.argv[1]
    start_pts = in_list(sys.argv[2])
    str_lens = in_list(sys.argv[3])
    start_pts, str_lens = adapt(start_pts, str_lens)
    dirpath = FILES_FOR_PROOF
    # if os.path.exists(dirpath) and os.path.isdir(dirpath):
